  ["generalizers"] = "<html><body><h1>generalizers</h1><p>generalizer<p></p>n.<p></p>generalize的变形<p></p>generalize<p></p>['dʒenərəlaiz]<p></p>vt.<p></p>对…进行概括，从…概括出一般规律：<p></p>to help the student generalize what he has learned<p></p>帮助学生对他所学过的内容进行归纳<p></p>从…引出一般性结论，归纳出，概括出，推断出：<p></p>to generalize a conclusion from a collection of facts<p></p>从大量事实中引出结论<p></p>使一般化；赋予…以共性；使具一般形式<p></p>使普及，推广；使广义化：<p></p>They hope to generalize the use of this new soap.<p></p>他们希望推广这种新型香皂的应用。<p></p>使含糊<p></p>【数学】用通式表示<p></p>【书画刻印艺术】表现…的典型性特色<p></p>vi.<p></p>形成概念，做出推断；概括：<p></p>One cannot generalize from a few examples.<p></p>不能从几个事例中得出一般性概念。<p></p>笼统地讲(或写)；从原则上考虑；含糊地处理：<p></p>It is impossible to generalize about children's books, as they are all different.<p></p>笼统地谈儿童读物是不可能的，因为它们之间都不一样。<p></p>延及全身<p></p>(到处)推广，普遍化，变得一般<p></p>变形：<p></p>vt.<p></p>generalized<p></p>. generalizing</p></body></html>",
